import React from "react";
import { Link } from "react-router-dom";
import styles from "./Login.module.css";

const LoginPage = () => {
  return (
    <div>
      <h1 className={styles.title}>LoginPage</h1>
      <button as={Link} to="/carrito"></button>
    </div>
  );
};

export default LoginPage;
